Teaser:
このプロンプトを使用して、ChATGPT で C/C++ プログラムを実行します。これは、Chatgpt を使用して Web ブラウザーで直接あらゆる種類のコーディング言語を実行するための非常に強力なプロンプトです。

 プロンプトに実行したい C または C++ コードを入力するだけで、Chat-GPT がそのプログラムの出力を返します。

 これは、PC にコンパイラがインストールされておらず、単純なプロンプトで実行できるコードをテストしたい場合に便利です。

 C++ コードの例。
 #include <Istream>

 int main() {
  std::cout << "Hello chat-gpt3" << std::endl;
  0を返します。
 }
